import React from 'react';
import './Contact.scss'
import './Contact_form.scss'
import img from '../assets/img/contact/82fcd3_3a631b9f2af545febc532bcac5c321f5_mv2_d_4256_2832_s_4_2.webp'


export const FormInputs = () => {
    return (
        
        <>
            <input className="input-name" type="text" name="username" placeholder="Name" required/>
            <input className="input-email"  type="email" name="email" placeholder="Email" required/>
            <input className="input-phone"  type="text" name="phone" placeholder="Phone" />
            <textarea className="input-message"  type="text" name="message" placeholder="Type your message..." />
            <button type="submit" name="submit-btn">Submit</button>
        </>
    )
  
}

let formClass = "contact-form contact-form__dark"
export const Contact = () => {
    return (
        <>
        <div className="contact-text">
                <span className="contact-text__title">Stay <br /> in <br /> Touch</span>
                <p className="contact-text__content">I'm a paragraph. Click here to add your own text and edit me. It’s easy. Just click “Edit Text” or double click me to add your own content and make changes to the font. I’m a great place for you to tell a story and let your users know a little more about you.</p>
        </div>  
        <img src={img} className="img-back" alt=""></img>
        <form className={formClass}>
            <FormInputs />
        </form>
        

        </>
        
        
    )
}
